import React from 'react';
export default function test({ countries, value }) {
    return (
        <div  className='custom_select'>
              
            <select  
            val
            >
                {countries.map(({ Country, ISO2 }) => (
                    <option key={ISO2} value={ISO2.toLowerCase() } >
                        {Country}
                    </option>
                ))}
            </select>
          
           
        </div>
    );

}
